import React from "react";
import { AppBar, Toolbar, Typography, Box, Button } from '@mui/material';
import { NavLink } from "react-router-dom";

const Header = () => {
    return (
        <AppBar sx={{background:"radial-gradient(circle, rgba(238,174,202,1) 0%, rgba(148,148,233,1) 100%);"}} position="sticky">
            <Toolbar>
                <Typography variant="h4">Blog App</Typography>
                <NavLink to="/" style={{ color: "white" }}></NavLink>
                <Box display="flex" marginLeft="auto">
                    <Button LinkComponent={NavLink} to="/login" variant='contained' sx={{margin:2, borderRadius: 10}}>Login</Button>
                    <Button LinkComponent={NavLink} to="/signup" variant='contained' sx={{margin:2, borderRadius: 10}}>Sign-up</Button>
                </Box>
            </Toolbar>
        </AppBar>
    )
}

export default Header
